import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button, Alert, Breadcrumb, Cart, Card } from 'react-bootstrap';
import styled from 'styled-components';
import './styled';
import Navbar1 from './Navbar1';
import CoverForManga from '../CoverForManga/png';

function App() {
	return (
		<div className="App">
			<Navbar1 />

			{/* Hero */}
			<section className="mb-5 bg-light">
				<div className="jumbotron jumbotron-fluid herocustom p-5 d-flex justify-content-center">
					<div className="container d-flex justify-content-center">
						<div className="row">
							<img
								src="/CoverForManga"
								className="img-fluid mx-auto images-hero"
								alt="Example of Successful Manga"
							/>
						</div>
					</div>
				</div>
			</section>
		</div> // Dont touch this div or anything beyond here
	);
}

export default App;
